import React, { Component } from 'react';
import '../Product.css';
const Product = () => {
    return ( 
    <div className="product">
        <div className="product__info">
            <p>
                The lean startup: How Con
            </p>
            <p className="product__price">
                <small>$</small>
                <strong>19.99</strong>
            </p>
            <div className="product__rating">
                 <p>⭐️</p>

            </div>
            <img src="https://images-eu.ssl-images-amazon.com/images/I/51CTIr1bJxL._SY264_BO1,204,203,200_QL40_FMwebp_.jpg" />

        </div>   
        <button>Add to Basket</button>  
    </div> );
}

export default Product;
